import React from "react";

const VideoItem = (props) => {

  return (
    <div className="item">
      <div className="ui small image">
        <img alt="alt" src={props.video.snippet.thumbnail} />
      </div>
      <div className="middle aligned content">
        <a href={props.video.channelId} className="header">
          {props.title}
        </a>
      </div>
    </div>

  );
};

export default VideoItem;
